import styles from './Project.module.css'
import ProjCard from './ProjCard'
import TopicName from './TopicName';
import img1 from '../assets/dev1.png'
import img2 from '../assets/dev2.jpg'
// import img3 from '../assets/dev3.png'
// import img4 from '../assets/dev4.png'

function Project(){
    return (

        <div className={styles.wrapper}>
            <TopicName title="Projects"></TopicName>
            <center>
            <ProjCard title={"Blogs Website"} image={img1} tags={["Web", "HTML", "CSS", "JS"]}info={"A simple Blogs made using the Hugo Framework"}></ProjCard>
            <ProjCard title={"Blogs Website"} image={img2} tags={["Python", "Kivy", "KivyMD", "Linux"]} info={"A simple Blogs  took advantage of that fact and made a simple Blogs website for myself :)"}></ProjCard>

            </center>

        </div>
    )
}
export default Project;
